import * as t from "react";
import e from "../lib/SSRBase.es.js";
import r from "../defs/Lightning.es.js";
const o = t.forwardRef((i, n) => /* @__PURE__ */ t.createElement(e, { ref: n, ...i, weights: r }));
o.displayName = "LightningIcon";
const g = o;
export {
  g as Lightning,
  o as LightningIcon
};
